def remove(s: str) -> str:
    r = s.replace('!', '')
    return r + '!' * (len(s) - len(r))

def remove(s):
    i = 0
    count = 0
    while i < len(s):
        if s[i] == "!":
            count += 1
            i += 1
        else:
            i += 1
    i = 0
    s = s.replace("!", "")
    while i < count:
        s += "!"
        i += 1
    return s

def remove(s):
    t = s.translate(None, '!')
    return t + '!' * (len(s) - len(t))

def remove(s):
    count = s.count('!')
    return s.replace('!', '') + '!' * count

def remove(s):
    n = s.count("!")
    return s.replace("!", "") + "!" * n
